import * as axios from "axios";

const instance = axios.create({
  getURL: "https://social-network.samuraijs.com/api/1.0/ ",
});

export const getUsers = (mpageq = 1, mklient = 10) => {
  return axios
    .get(getUrl + `users?page=${mpageq}&count=${mklient}`, {
      withCredentials: true,
    })
    .then((response) => response.data);
};
